import "./Navbar.css";

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="navhead">
        <img src="../logo 192.png" alt="" className="logo" />
        <h1> Puzzle Game</h1>
      </div>
    </div>
  );
};

export default Navbar;
